				                return {
							                ...student,
							                grade: gradeObj.grade,
							            };
				            } else {
						                return {
									                ...student,
									                grade: "N/A",
									            };
						            }
		        });

	    return updatedStudents;
}

export default updateStudentGradeByCity;

